import { Component } from 'react';
import OrderItem from "../../components/order-item/OrderItem";
import { Constants } from "../../Constants";
import "./UserInProgress.css";
import { GridList } from "@material-ui/core";

export default class UserProgress extends Component {

    render() {
        return (
            <div className="progress-container">
                <GridList cols={3} cellHeight={260} style={{ height: 'auto' }} >
                    {
                        this.props.userInProgress.map(order =>
                            <ul key={order.id}>
                                <OrderItem key={order.title} data={order}
                                    user={this.props.user}
                                    onClickViewOrder={this.props.onClickViewOrder} />
                            </ul>
                        )
                    }
                </GridList>
            </div>
        );
    }
}
